import React from 'react';
import './App.css';
import axios from 'axios'



class App extends React.Component {

  componentDidMount() {
    this.getData()
  }
  async getData(){
    const response =
      await axios.get("http://localhost:8000/api/music")

    let albums = response.data[0].albums.split(',');
    let artists = response.data[0].artists.split(',');
    let songs = response.data[0].songs.split(',');

    let albumsElement = document.getElementById('albums');
    let artistsElement = document.getElementById('artists');
    let songsElement = document.getElementById('songs');

    console.log(albumsElement)

    albums.forEach(album => {
        albumsElement.appendChild("<li>" + album + "</li>")        
    });


    artists.forEach(artist => {
      artistsElement.appendChild("<li>" + artist + "</li>")        
    });

    songs.forEach(song => {
      songsElement.appendChild("<li>" + song + "</li>")        
    });
  };



  render(){
    return (
      <div className="App">
        <header className="App-header">
          <div>
            Albums
              <ul id="albums">

              </ul>
          </div>
          <div>
            Artists
              <ul id="artists">

              </ul>
          </div>
          <div id="songs">
            Songs
              <ul>

              </ul>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
